(273, 3, '2023-07-31 11:28:52', 'books', 'edit', '{\"id\":4,\"bookTitle\":\"Rerum iste at iste aut.\",\"isbn\":\"9787745243770\",\"genre\":\"Arts\",\"author\":\"Antonetta Wuckert\",\"synopsis\":\"Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \\\"de Finibus Bonorum et Malorum\\\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \\\"Lorem ipsum dolor sit amet..\\\", comes from a line in section 1.10.32. The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \\\"de Finibus Bonorum et Malorum\\\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.\",\"publisher\":\"Lake Dejonstad\",\"publishingDate\":\"2015-03-05\",\"illustrator\":\"Rae Waelchi\",\"totalPages\":278,\"quantity\":318,\"image\":\"1654414717.jpg\",\"created_at\":\"2022-03-21 14:44:18\",\"updated_at\":\"2022-06-05 07:38:38\"}'),
